import React, { useState } from "react";
import { useEffect } from "react";

const HostVans = () => {
  const [hostVans, SetHostVans] = useState([]);
  useEffect(() => {
    fetch("/api/host/vans")
      .then((res) => res.json())
      .then((data) => SetHostVans(data));
  }, []);
  const HostVansElements = hostVans.map((item) => {});
  return (
    <div>
      <h1>Host Vans</h1>
    </div>
  );
};

export default HostVans;
